#[no_mangle] pub extern "system"
fn post_message_to_ahk() -> *const WideChar {
  let listed_all         	= U16CString::from_str("listed all, found none").expect("Some null?");
  let found_or_failed    	= U16CString::from_str("found or failed").expect("Some null?"); // if cb_ return 0 to stop enumeration, EnumWindows also returns 0, which is the same as failed
  let ptr_listed_all     	= listed_all.into_raw();
  let ptr_found_or_failed	= found_or_failed.into_raw();
  unsafe {
    match EnumWindows(    	  	// Enumerates all top-level windows on the screen by passing the handle to each window, in turn, to an application-defined callback function until the last top-level window is enumerated or the callback function returns FALSE learn.microsoft.com/en-us/windows/win32/api/winuser/nf-winuser-enumwindows
      Some(cb_enum_window)	, 	// WNDENUMPROC	pointer to an app-defined             callback function
      LPARAM(0)           	){	// LPARAM     	app-defined value to be passed to the callback function
      BOOL(0)             	=> return ptr_found_or_failed,
      _                   	=> return ptr_listed_all,
    }
   }
  // ret_found_or_failed.as_ptr()
  // unsafe{
    // let win_id:HWND = GetForegroundWindow(); // works when AHK is in the foreground
    // let postres = PostMessageW(win_id, externalMsgID, None, None);
    // MessageBoxW(None,h!("asd"),h!("@msg2ahk.rs Found Class↓"),MB_OK);
  // }
  // let test_str	= U16CString::from_str("U16CString"); // if cb_ return 0 to stop enumeration, EnumWindows also returns 0, which is the same as failed
}

fn post_message_to_ahk_found(win_id:HWND) -> BOOL {
  let lparam = LPARAM(2);
  let wparam = WPARAM(1);
  let postres:BOOL;
  let msg_id_ws = Utf16String::from_str(externalMsgIDs);
  let msg_id_pc	= PCWSTR(msg_id_ws.as_ptr());
  let msg_id_str = 5u32.to_string();
  let msg_id_str_w = Utf16String::from_str(&msg_id_str);
  unsafe {
    let msg_id	= RegisterWindowMessageW(msg_id_pc);
    postres   	= PostMessageW(win_id, msg_id, wparam, lparam);
    // if 3 <= dbg {MessageBoxW(None,PCWSTR(msg_id),h!("@post_message_to_ahk_found: msg_id"),MB_OK);}
  } // Send/PostMessage return 0 and if you check the last error using GetLastError() you will get a value of 1400 - ERROR_INVALID_WINDOW_HANDLE
  postres
}

use std::borrow::Cow;
extern "system" fn cb_enum_window(win_id:HWND, _:LPARAM) -> BOOL { // callback function
  let ahk_title_re = Regex::new(ahk_titles_rep).unwrap();
  let mut win_title:[u16;512] = [0; 512];
  let mut win_class:[u16;512] = [0; 512];
  let (win_title_len,win_class_len):(i32,u32)	;
  unsafe {
    win_title_len	= GetWindowTextW     	(win_id, &mut win_title);
    win_class_len	= RealGetWindowClassW	(win_id, &mut win_class);
  }
  let win_title                   	= String::from_utf16_lossy(&win_title[..win_title_len as usize]);
  let win_class_w:Cow<'_,Utf16Str>	= Utf16String::from_slice_lossy(&win_class);
  let win_class                   	= String::from_utf16_lossy(&win_class[..win_class_len as usize]);
  let win_class_pc                	= PCWSTR(win_class_w.as_ptr());

  let mut info = WINDOWINFO {
    cbSize: core::mem::size_of::<WINDOWINFO>() as u32,
    ..Default::default()
  };
  unsafe { GetWindowInfo(win_id, &mut info).unwrap(); }

  // if !win_title.is_empty() && info.dwStyle.contains(WS_VISIBLE) {
  //   println!("{} ({}, {})", win_title, info.rcWindow.left, info.rcWindow.top);
  // }

  let is_match_ahk_title = ahk_title_re.is_match(&win_title);
  if is_match_ahk_title.is_ok() //&& info.dwStyle.contains(WS_VISIBLE)
    && win_class.contains("AutoHotkey") {
    let msg_posted_out = post_message_to_ahk_found(win_id);
    // if 3 <= dbg {unsafe{MessageBoxW(None,win_class_pc,h!("@msg2ahk.rs Found Class↓"),MB_OK);}}
    // todo: something is broken, message not received acknowledged
    // if 3 <= dbg {unsafe{MessageBoxW(None,PCWSTR(msg_posted_out.0),h!("@msg2ahk.rs Found Class↓"),MB_OK);}}
    false.into()
  } else {
    true.into()
  }
}



